import React from 'react';

function App() {
  return (
    <div className="container mt-5">
      <div className="row justify-content-center">
        <div className="col-md-6">
          <div className="card text-center shadow">
            <div className="card-body">
              <h1 className="card-title display-4 mb-3">Hello, World!</h1>
              <p className="card-text">Welcome to your simple React app styled with <strong>Bootstrap</strong>.</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
